🥬 K A L E 🥬
————————————————————————
Plate • What’s dis • Yelling at dinner • We love mealtime ————————————————————————
Today we tried kale! Leafy greens are a tricky food because it’s such a difficult texture for babies to chew and swallow. So when I saw these, I was super excited to introduce kale in a different way. I air fried these at 400 for 12 minutes. I squished them between my fingers to flatten them for her. Unfortunately she wasn’t super excited about this food, but I will keep trying! @babyledweanteam #MealtimeWithMila #BLW #BabyLedWeaning #100FirstFoods #Veggies #Kale";}i:108;a:1:{s:14:"comments_count";i:0;}i:109;a:1:{s:11:"likes_count";i:1;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu9dMkA5nm";}i:111;a:1:{s:5:"image";s:250:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118844593_3193716987382843_6406562835753634565_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=107&_nc_ohc=5d7j6kybA0sAX9gczUb&oh=2009bb4fa59648ed4eb3ccfbe03f3911&oe=5F7C4C58";}i:112;a:1:{s:4:"type";s:7:"sidecar";}i:113;a:1:{s:8:"owner_id";i:36967509025;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id";s:19:"2391116676497024840";}i:118;a:1:{s:10:"short_code";s:11:"CEu8_LXHidI";}i:119;a:1:{s:12:"created_time";i:1599263341;}i:120;a:1:{s:7:"caption";s:91:"My fall crop has started coming in. #lettuce #beets #carrots #spinach #kale #arugula #basil";}i:121;a:1:{s:14:"comments_count";i:0;}i:122;a:1:{s:11:"likes_count";i:2;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu8_LXHidI";}i:124;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118778513_781990832360473_1323958916879263685_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=A77KdKIcTTEAX-Qno9l&oh=19f23653a0a18e7d31ccb6bd9479abcd&oe=5F7DF726";}i:125;a:1:{s:4:"type";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:3306117693;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391115839849048512";}i:131;a:1:{s:10:"short_code";s:11:"CEu8zALAynA";}i:132;a:1:{s:12:"created_time";i:1599263242;}i:133;a:1:{s:7:"caption";s:1526:"The ubiquitous #Spaghetti #Squash Series! I cooked such a huge Squash that I was able to make 4 different dishes of large single servings for myself. I posted the first one a few days ago. Here are the other three. 
.
 Organic Spaghetti Squash with #BrusselSprouts, #GreenBellPepper, and #Avocado
I #steamed the Brussel Sprouts as I heated the Spaghetti Squash in a pan.  I also had time to prepare the Avocados and dice the Pepper. 

When you open an Avocado it’s a bit of a crap shoot. I was lucky today! Two perfectly ripe and beautiful Avocados! 

Organic Spaghetti Squash with #Kale, #RedBeets, and #Mushrooms.
I chopped the kale up and steamed it with the beets, adding the mushrooms later, and slicing the Avocados to add last. Really delicious and so nutritious of course. Some seasonings and #CoconutAminoAcids and ready to go! 

All Organic Spaghetti Squash #veggiesoup
I sautéed #portobellomushrooms, #ShitakeMushrooms , #celery and #carrots in veggie broth while I heated the seasoned Spaghetti Squash and #veggiebroth. When done I added the sautéed veggies into the pot with the Squash. 

I had run out of onions which I would have normally included in a soup like this and when I tasted it I thought it needed something more for flavor. Ah! I had a half jar of tomato Basil #redsauce which worked perfectly. It saved the day really. The cupboards are almost bare now so a shopping trip is in the works soon! 
