💚 
It's so awesome, like watching a unicorn to me, he'll just go outside and pick stuff and wash it off and eat it. Last night he grabbed an Anaheim, this is my first year growing them and grabbed his plastic knife, cut it and tried it, decided he'd like it better with ranch 😫🤣 and ate it. 
💚
Growing up this wasn't my experience. the only green I ate and was exposed to came from a can. I still struggle but I try so much more and even eat more. The best seed I've ever planted in my garden, is the seed I've planted in him. ❤
