";}i:209;a:1:{s:10:"short_code";s:11:"CEu7aMeBu_t";}i:210;a:1:{s:12:"created_time";i:1599262514;}i:211;a:1:{s:7:"caption";s:1367:"Unpopular opinion: pesto>red sauce! This pesto dish will for sure satisfy any pesto craving. If you don’t want to make your own pesto, just use store bought pesto but this homemade pesto is so much better! P.S-there is a vegan option!
Recipe:
-blend 2 cups basil, 2 cups spinach or kale, 1/4 cup pine nuts, walnuts, almonds, pepitas etc, 2 cloves garlic, 1/4 cup olive oil, 1/4 cup parmesan or 2 TB nutritional yeast, 1/4 tsp salt, juice of 1/4 lemon and your favorite spices. This is your pesto! You can add more or less olive oil depending on what thickness you like.
-next, preheat the oven to 425. On a baking tray, mix 3+ cups of your favorite veggies with 1 tsp olive oil, salt, pepper, spices and lemon juice for 10+ mins. (It depends on your veggies used, so keep an eye on it!)
-cook a box of any pasta of choice.
-mix together the pasta, pesto, 1/2 cup sundried tomatoes and spices.
-enjoy!!!
I hope you love this dish as much as my family and I do!!
